  {
    path:'/products/driver/ping',
    component: DriverPing,
    name:'DriverPing'
  },
  {
    path:'/products/driver/taylormade',
    component: DriverTaylor,
    name:'DriverTaylor'
  },
  {
    path:'/products/driver/pxg',
    component: DriverPxg,
    name:'DriverPxg'
  },
  {
    path:'/products/driver/titleist',
    component: DriverTitle,
    name: 'DriverTitle'
  },
  {
    path:'/products/driver/Honma',
    component: DriverHonma,
    name: 'DriverHonma'
  },
  {
    path:'/products/driver/xxio',
    component: DriverXxio,
    name: 'DriverXxio'
  },
  {
    path:'/products/driver/yamaha',
    component: DriverYamaha,
    name: 'DriverYamaha'
  },
  {
    path:'/products/driver/mizuno',
    component: DriverMizuno,
    name: 'DriverMizuno'
  },
  {
    path:'/products/driver/fourteen',
    component: DriverFourteen,
    name: 'DriverFourteen'
  },
  {
    path:'/products/driver/majesty',
    component: DriverMajesty,
    name: 'DriverMajesty'
  },
  {
    path:'/products/wu',
    name:'WuPage',
    component: WuPage,
  },
  {
    path:'/products/wu/ping',
    component: WuPing,
    name:'WuPing'
  },
  {
    path:'/products/wu/taylormade',
    component: WuTaylor,
    name:'WuTaylor'
  },
  {
    path:'/products/wu/pxg',
    component: WuPxg,
    name:'WuPxg'
  },
  {
    path:'/products/wu/titleist',
    component: WuTitle,
    name: 'WuTitle'
  },
  {
    path:'/products/wu/Honma',
    component: WuHonma,
    name: 'WuHonma'
  },
  {
    path:'/products/wu/xxio',
    component: WuXxio,
    name: 'WuXxio'
  },
  {
    path:'/products/wu/yamaha',
    component: WuYamaha,
    name: 'WuYamaha'
  },
  {
    path:'/products/wu/mizuno',
    component: WuMizuno,
    name: 'WuMizuno'
  },
  {
    path:'/products/wu/fourteen',
    component: WuFourteen,
    name: 'WuFourteen'
  },
  {
    path:'/products/wu/majesty',
    component: WuMajesty,
    name: 'WuMajesty'
  },
  {
    path:'/customer/sign-up',
    component: SignUp,
    name: 'SignUp'
  },
  {
    path:'/secret/security'
  }
];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
